@ShahidNazirPPP @MHassan_PPP @pnnnews ہونا تو چاہیے کہ @S_HassanMurtaza بھائی اس چینل کے مالک کو احتجاج رکارڈ کروائیں ، ٹھیک ہے پروگرام چلتے ہیں لیکن آپ نے ایک یوتھیے کو اپنا پلیٹ فارم دے دیا ہے وہ ہمارے چیئرمین پر ذاتی اٹیک کریں ، یہ ناقابل برداشت ہے ۔
